(12,'LIBRO DE ACTUARIO (OFICIAL)','<p>Libro a nivel de la secretaria general de la sala.</p>',1,0,'LIBRO DE ACTUARIO (OFICIAL)','lsc10','lsc10s','lsc10','lsc10s',13,'','','{\"generate_admin\":\"1\",\"generate_site\":\"1\",\"generate_site_views\":\"1\",\"generate_site_layout_article\":\"0\",\"generate_site_layout_blog\":\"0\",\"generate_admin_dashboard\":\"1\",\"generate_categories\":\"1\",\"generate_categories_site_views_categories\":\"1\",\"generate_categories_site_views_category\":\"1\",\"generate_plugins\":\"0\",\"generate_plugins_search\":\"0\",\"generate_plugins_finder\":\"0\",\"generate_plugins_itemnavigation\":\"0\",\"generate_plugins_vote\":\"0\",\"generate_plugins_pagebreak\":\"0\",\"generate_plugins_emailcloak\":\"0\",\"generate_plugins_loadmodule\":\"0\",\"generate_plugins_events\":\"0\",\"generate_modules\":\"0\"}','{\"include_access\":\"\",\"include_alias\":\"\",\"include_assetacl\":\"\",\"include_assetacl_record\":\"\",\"include_batch\":\"\",\"include_checkout\":\"\",\"include_copy\":\"\",\"include_created\":\"\",\"include_description\":\"\",\"include_featured\":\"\",\"include_hits\":\"\",\"include_image\":\"\",\"include_intro\":\"\",\"include_language\":\"\",\"include_metadata\":\"\",\"include_microdata\":\"\",\"include_modified\":\"\",\"include_name\":\"\",\"include_ordering\":\"\",\"include_params_global\":\"\",\"include_params_menu\":\"\",\"include_params_record\":\"\",\"include_published_dates\":\"\",\"include_status\":\"\",\"include_tags\":\"\",\"include_urls\":\"\",\"include_versions\":\"\"}',1,'2017-08-19 19:39:21',1,'','2017-10-27 22:45:52',1,0,'0000-00-00 00:00:00',3,10),
(13,'LIBRETA DE OFICIOS (OFICIAL)','<p>Libro a nivel de la secretaria general de la sala.</p>\r\n<p>En libros de primera instancia se han generado tickets debido al consecutivo de libros, pues éste no siempre les coincide con el número de oficio.</p>\r\n<p>Al momento de hacer la implementación de éste libro sería conveniente establecer si el sistema les debe proporcionar el consecutivo siguiente para que éste sea usado como número de oficio o bien, si es al contrario y primero escriben el oficio y luego lo registran en el Sistema. La segunda opción puede generar problemas por duplicados debido a que mientras un usuario escribe un oficio, otro puede intentar registrar uno con el mismo número progresivo.</p>\r\n<p>20170929 DEGT indicó que el NÚMERO DE OFICIO no es consecutivos del sistema, es campo abierto de texto.</p>.<br/>El expediente es opcional',1,0,'LIBRETA DE OFICIOS (OFICIAL)','lsc11','lsc11s','lsc11','lsc11s',14,'','','{\"generate_admin\":\"1\",\"generate_site\":\"1\",\"generate_site_views\":\"1\",\"generate_site_layout_article\":\"0\",\"generate_site_layout_blog\":\"0\",\"generate_admin_dashboard\":\"1\",\"generate_categories\":\"1\",\"generate_categories_site_views_categories\":\"1\",\"generate_categories_site_views_category\":\"1\",\"generate_plugins\":\"0\",\"generate_plugins_search\":\"0\",\"generate_plugins_finder\":\"0\",\"generate_plugins_itemnavigation\":\"0\",\"generate_plugins_vote\":\"0\",\"generate_plugins_pagebreak\":\"0\",\"generate_plugins_emailcloak\":\"0\",\"generate_plugins_loadmodule\":\"0\",\"generate_plugins_events\":\"0\",\"generate_modules\":\"0\"}','{\"include_access\":\"\",\"include_alias\":\"\",\"include_assetacl\":\"\",\"include_assetacl_record\":\"\",\"include_batch\":\"\",\"include_checkout\":\"\",\"include_copy\":\"\",\"include_created\":\"\",\"include_description\":\"\",\"include_featured\":\"\",\"include_hits\":\"\",\"include_image\":\"\",\"include_intro\":\"\",\"include_language\":\"\",\"include_metadata\":\"\",\"include_mic