(6,'Component Architect Manager','<p>@ToDo bug : on editor on type CTRL+S do not save, only refresh de page administrator/index.php?option=com_componentarchitect&amp;view=component&amp;layout=edit&amp;id=?</p>\r\n<p> </p>\r\n<p>Component Architect is a Joomla! extension that allows for the automated code generation of other Joomla! extensions (components, modules and plugins).</p>\r\n<p>CHANGELOG</p>\r\n<p>20170728 inicial</p>\r\n<p>20170731 Add ACL, fix bugs</p>\r\n<p>20170804 Add codetemplates</p>\r\n<p>20170805 Add Ant task to debug, fix bugs, add configurations for UCM and history options</p>\r\n<p>20170819 Improve INCLUDE_ALIAS, comment scripts,</p>\r\n<p>20170820 Improve ACL,</p>\r\n<p>20170828 Remove HTML documentations, add LATEX automatic documentation</p>\r\n<p>20170830 Improve INCLUDE_ALIAS</p>\r\n<p>20170831 Add es-ES support, add DB constraints and comments, improve automatic documentation</p>\r\n<p>20170906 Improve DateTime GUI support</p>\r\n<p>20170910 Improve documentation, es-ES suppport</p>\r\n<p>20170913 Start export support</p>\r\n<p>20170915 Add control versions to ComponentArchitect</p>\r\n<p>20170915 Add Copy buttons</p>\r\n<p>20170915 Add Copy buttons</p>\r\n<p>20170921 change install.sql `created` DATETIME NOT NULL DEFAULT <strong>CURRENT_TIMESTAMP</strong>,</p>\r\n<p>20170921 add DATE type</p>\r\n<p> </p>\r\n<p>@ToDo</p>\r\n<p>Finish admin help buttons, JToolbar::help -&gt; pdf#section</p>\r\n<p>Finish dashboard</p>\r\n<p>Finish LATEX manuals or HTML manuals</p>\r\n<p>Finish ExtJS views (grids)</p>\r\n<p>Add state to each object</p>\r\n<p>Finish export support</p>\r\n<p>Add key to id_expediente, field.filter = false quita TABLE.KEY</p>','caballeroantonio','1.2.0tx','caballeroantonio.com','caballeroantonio@hotmail.com','component_architect','Copyright (c)2013 - 2016 Simply Open Source Ltd. (trading as Component Architect). All Rights Reserved',0,'','','','','{\"generate_admin\":\"1\",\"generate_site\":\"0\",\"generate_site_views\":\"0\",\"g