(20,'TSJ CDMX Libros txCA lsc','<div class=\"standard\">El objetivo del componente es sustituir los libros físicos que se utilizan en los órganos jurisdiccionales de Segunda Instancia Cívil del TSJ CDMX por libros virtuales.</div>\r\n<div class=\"standard\"> </div>\r\n<div class=\"standard\"><strong>CHANGELOG</strong></div>\r\n<div class=\"standard\">20170919 Todos los field.filter = false para evitar SELECT DISCTINCT</div>\r\n<div class=\"standard\">20170919 se agregó FIELD_TYPE = expediente, name reemplaza expedienteFriendlyName</div>\r\n<div class=\"standard\">20170921 quitar \'PARTES DEL JUICIO\' (actor, demandado, otros) del nivel 1, add expediente de origen nivel 2, remove Expediente del nivel 1</div>\r\n<div class=\"standard\">20170921 se agregó validaciones a todos los campos fecha</div>\r\n<div class=\"standard\">20170922 se agregó FIELD_TYPE = firma, se cambiaron los campos al FIELD_TYPE {expediente|firma}</div>\r\n<div class=\"standard\">\r\n<p>20171115 Cervantes solicitó quitar la distribución (campo ponencia o dpto)</p>\r\n<p>20171115 Cervantes solicitó ocultar los campos \"juicio\" hasta nuevo aviso.<br />cuando sea permatente regenerar tablas, vistas y published = false;<br />lsc04    field138<br />lsc06    field156<br />lsc09    field190<br />lsc10    field197</p>\r\n<p>20171115 Cervantes desplegar la información del libro lsc05 en la vista calendario</p>\r\n<p>Cervantes solicitó que se disgregaran las huellas y firmas para que sean solicitadas por separado en los levantamientos de libros</p>\r\n</div>\r\n<div class=\"standard\"> </div>\r\n<div class=\"standard\"><strong>@ToDo</strong></div>\r\n<div class=\"standard\">- Remover todas las \'PARTES DEL JUICIO\' libros y agregarlo en objeto expediente</div>\r\n<div class=\"standard\">- Generar modificar el objeto modal para que permita capturar id_expediente, id_expediente_origen, elegir un expediente en de éste órgano y un expediente de origen de otro organo.</div>\r\n<div class=\"standard\">- Permitir registrar: AUTORIZADO POR QUÉ PARTE, PARTE ACTORA, PARTE DEMANDADA</div>\r\n<div class=\"standard\">Add key to id_expediente, field.filter = false quita TABLE.KEY</div>\r\n<div class=\"standard\">\r\n<p>Make expediente de origen, read only on 1ra instancia</p>\r\n</div>\r\n<p> </p>\r\n<p> </p>','caballeroantonio','1.0.0','caballeroantonio.com','caballeroantonio@hotmail.com','jt_ca','Copyright (c) 2017 - 2020. All Rights Reserved',1,'','','','','{\"generate_admin\":\"1\",\"generate_site\":\"1\",\"generate_site_views\":\"1\",\"generate_site_layout_article\":\"0\",\"generate_site_layout_blog\":\"0\",\"generate_admin_dashboard\":\"1\",\"generate_categories\":\"0\",\"generate_categories_site_views_categories\":\"0\",\"generate_categories_site_views_category\":\"0\",\"generate_plugins\":\"0\",\"generate_plugins_search\":\"0\",\"generate_plugins_finder\":\"0\",\"generate_plugins_itemnavigation\":\"0\",\"generate_plugins_vote\":\"0\",\"generate_plugins_pagebreak\":\"0\",\"generate_plugins_emailcloak\":\"0\",\"generate_plugins_loadmodule\":\"0\",\"generate_plugins_events\":\"0\",\"generate_modules\":\"0\"}','{\"include_access\":\"0\",\"include_alias\":\"0\",\"include_assetacl\":\"1\",\"include_assetacl_record\":\"0\",\"include_batch\":\"0\",\"include_checkout\":\"0\",\"include_copy\":\"1\",\"include_created\":\"1\",\"include_description\":\"0\",\"include_featured\":\"0\",\"include_hits\":\"0\",\"include_image\":\"0\",\"include_intro\":\"0\",\"include_language\":\"0\",\"include_metadata\":\"0\",\"include_microdata\":\"0\",\"include_modified\":\"1\",\"include_name\":\"0\",\"include_ordering\":\"1\",\"include_params_global\":\"0\",\"include_params_menu\":\"0\",\"include_params_record\":\"0\",\"include_published_dates\":\"0\",\"include_status\":\"1\",\"include_tags\":\"0\",\"include_urls\":\"0\",\"include_versions\":\"1\"}',1,'2017-08-19 19:34:58',1,'','2017-12-23 22:21:10',1,0,'0000-00-00 00:00:00',5,14),
