(24,'RealEstateManager','<ul>\r\n<li>De momento plural_name va a conservar los nombres del código fuente original</li>\r\n<li>Cambiar los campos published por JoomlaFeatured.Status (state), ya comprobé que son compatibles.</li>\r\n<li>Tiene implementado acceso a registros por grupos definidos en jos_rem_main_categories.params que es del tipo text y resulta muy costoso computacionalmente</li>\r\n<li></li>\r\n</ul>\r\n<p>CHANGELOG</p>\r\n<ul>\r\n<li>20180123 Se modificó el ENGINE de las tablas para soportar CONSTRAINTS, se agregó la tabla vivanuncios_items que contiene los datos del scraping, se agregó indices a las columnas published para acelerar las búsquedas</li>\r\n<li>20180125 cambié published por state para generarlo desde joomla_features</li>\r\n<li>20180125 deshabilite #__rem_houses.approved, considero que no se debería utilizar porque existe published indexado, y approved es costoso.</li>\r\n</ul>','caballeroantonio','1.0.0','caballeroantonio.com','caballeroantonio@hotmail.com','remca','',0,'','','','','{\"generate_admin\":\"1\",\"generate_site\":\"1\",\"generate_site_views\":\"1\",\"generate_site_layout_article\":\"1\",\"generate_site_layout_blog\":\"1\",\"generate_admin_dashboard\":\"1\",\"generate_categories\":\"1\",\"generate_categories_site_views_categories\":\"1\",\"generate_categories_site_views_category\":\"1\",\"generate_plugins\":\"1\",\"generate_plugins_search\":\"1\",\"generate_plugins_finder\":\"1\",\"generate_plugins_itemnavigation\":\"1\",\"generate_plugins_vote\":\"1\",\"generate_plugins_pagebreak\":\"1\",\"generate_plugins_emailcloak\":\"1\",\"generate_plugins_loadmodule\":\"1\",\"generate_plugins_events\":\"1\",\"generate_modules\":\"1\"}','{\"include_access\":\"1\",\"include_alias\":\"1\",\"include_assetacl\":\"1\",\"include_assetacl_record\":\"1\",\"include_batch\":\"1\",\"include_checkout\":\"1\",\"include_copy\":\"1\",\"include_created\":\"1\",\"include_description\":\"1\",\"include_featured\":\"1\",\"include_hits\":\"1\",\"include_imag